import React from "react";
import Card from "./Card";

function App() {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card
        name="Ryan Reynolds" />
      img="Ryan Reynolds"
      tel="+123 456 789"
      email="R@Reynolds.com"
    </div>
  );
}

export default App;
